import './App.css';

function App() {
  let count = 1;
  document.getElementById("plus").onclick = function(){
    count++;
    console.log(count);
  }

  return (
    <div className="App">
      <div id="counter">{count}</div>
      <hr></hr>
      <button id="plus">+</button>
      <button id="minus">-</button>
    </div>
  );

}

export default App;
